//raw.githubusercontent.com/b2renger/Introduction_p5js/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/Introduction_p5js/master/assets/01_dessiner_05.png","last_update":"01/09/19","author":"b2renger"},{"name":"Introduction à Pure-Data","id":"introduction_pure_pata","tags":["Pure-Data","Sound Design","FR"],"desc":"Une introduction à Pure-Data réalisée avec Pure-data. Pure-Data est le couteau suisse de l\'audio temps réel et plus aussi.","url":"https://raw.githubusercontent.com/b2renger/Introduction_Pure_Data/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/Introduction_Pure_Data/master/assets/image-02.png","last_update":"18/03/20","author":"b2renger"},{"name":"Introduction à Processing","id":"introduction_processing","tags":["Processing","Creative Coding","Interaction","Graphisme","FR"],"desc":"Une introduction à la programmation java avec Processing.","url":"https://raw.githubusercontent.com/b2renger/Introduction_Processing/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/Introduction_Processing/master/assets/020_pixels.png","last_update":"01/05/17","author":"b2renger"},{"name":"Transformation d\'images","id":"p5js_image_alteration","tags":["P5js","Creative Coding","Graphisme","Interaction","Print","Web","FR"],"desc":"Transformer une image en manipulant ses pixels. Utilisation de boutons et de sliders et exports svg / png","url":"https://raw.githubusercontent.com/b2renger/p5js_image_alteration/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/p5js_image_alteration/master/result_images/example_09_triangulation_anim.gif","last_update":"16/12/19","author":"b2renger"},{"name":"Generative Typography","id":"p5js_typo","tags":["P5js","Creative Coding","Typographie","Web","Interaction","EN"],"desc":"Some example on how to work with typography in p5js","url":"https://raw.githubusercontent.com/b2renger/p5js_typo/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/p5js_typo/master/assets/p5js_typo.gif","last_update":"23/11/16","author":"b2renger"},{"name":"Motifs génératifs","id":"p5js-designing-interactive-patterns","tags":["P5js","Creative Coding","Interaction","Graphisme","Web","FR"],"desc":"Utiliser des règles simples pour créer des motifs qui se répétent. Ce cours comporte une étude assez poussée des techniques de noise.","url":"https://raw.githubusercontent.com/b2renger/p5js-designing-interactive-patterns/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/p5js-designing-interactive-patterns/master/images/noise-asymetric.gif","last_update":"19/05/19","author":"b2renger"},{"name":"Patatap","id":"p5js_codecreatif","tags":["P5js","Creative Coding","Interaction","Motion","Web","FR"],"desc":"Un cours d\'introduction à p5js : chaque touche du clavier doit déclencher un son et un animation","url":"https://raw.githubusercontent.com/b2renger/p5js_codecreatif/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/p5js_codecreatif/master/gifs/patatap-final.gif","last_update":"08/04/20","author":"b2renger"},{"name":"Gestes de l\'ennui","id":"p5js_gestes_de_l_ennui","tags":["P5js","Processing","Arduino","Graphisme","Print","FR"],"desc":"Identifier, enregister et visualiser les gestes de l\'ennui avec arduino, processing et p5js. La finalité étant de produire une image imprimmable par sérigraphie","url":"https://raw.githubusercontent.com/b2renger/p5js_gestes_de_l_ennui/master/README.md","thumbnail":"https://raw.githubusercontent.com/b2renger/p5js_gestes_de_l_ennui/master/assets/realisation_finale_black.png","last_update":"16/12/19","author":"b2renger"},{"name":"Workshop Processing community day - Processing","id":"workshop_processing_PCD2019","tags":["Processing","Creative Coding","Interaction","FR"],"desc":"Un workshop d\'une demie-journée donné à Stereolux par des étudiants pour découvrir le code créatif","url":"https://raw.githubusercontent.com/AtelierNum/workshop_processing_PCD2019